import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';



class MeteoPage extends React.Component {
  render() {


    return (
    	<div class="container">

		<h2 id="city">Leeds</h2>

	<div class="middle">
		<img src="" alt="icon" id="icon"/>
		<div class="degrees">
			<h1 id="temp">19</h1>
			<span>&#176;</span>
		</div>
		<h3 id="desc">Sunny</h3>
		</div>

	</div>
    );
  }
}
ReactDOM.render(
  <MeteoPage />,
  document.getElementById('root')
);
